import ActivityCard from './ActivityCard';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col'

function App() {
  return (
    <div className="App">
<Container>
  <Row>
    <Col className="test" lg={3} md={3} xs={12}>profile card</Col>
    <Col className="test" lg={9} md={9} xs={12}>
      <Row>
        <Col lg={4} md={4} xs={12}> card-1</Col>
        <Col lg={4} md={4} xs={12}> card-2</Col>
        <Col lg={4} md={4} xs={12}> card-3</Col>
      </Row>
      <Row>
      <Col lg={4} md={4} xs={12}> card-4</Col>
        <Col lg={4} md={4} xs={12}> card-5</Col>
        <Col lg={4} md={4} xs={12}> card-6</Col>
      </Row>
    </Col>
  </Row>

</Container>
       <ActivityCard/>
    </div>
  );
}

export default App;
